window.bookSummaryJSON = "<p><b>Number-One </b><b><i>New York Times </i></b><b>Best Seller</b></p> <p><b>The thrilling sequel to the beloved worldwide best seller </b><b><i>Ready Player One</i></b><b>, the near-future adventure&nbsp;that inspired the blockbuster Steven&nbsp;Spielberg film.</b>&nbsp;</p> <p><b>Named One of the Best Books of the Year by the </b><b><i>Washington Post</i></b></p> <p><b>“The game is on again. ... A great mix of exciting fantasy and threatening fact.” (</b><b><i>The Wall Street Journal</i></b><b>)</b>&nbsp;</p> <p>An unexpected quest. Two worlds at stake. <i>Are you ready? </i></p> <p>Days after winning OASIS founder James Halliday’s contest, Wade Watts makes a discovery that changes everything.&nbsp;</p> <p>Hidden within Halliday’s vaults, waiting for his heir to find it, lies a technological advancement that will once again change the world and make the OASIS a thousand times more wondrous - and addictive - than even Wade dreamed possible.</p> <p>With it comes a new riddle, and a new quest - a last Easter egg from Halliday, hinting at a mysterious prize.&nbsp;</p> <p>And an unexpected, impossibly powerful, and dangerous new rival awaits, one who’ll kill millions to get what he wants.&nbsp;</p> <p>Wade’s life and the future of the OASIS are again at stake, but this time, the fate of humanity also hangs in the balance.&nbsp;</p> <p>Lovingly nostalgic and wildly original as only Ernest Cline could conceive it, <i>Ready Player Two</i> takes us on another imaginative, fun, action-packed adventure through his beloved virtual universe, and jolts us thrillingly into the future once again.</p>"; 
